  ValidationPrintValids: False
  ShortNames: False
  MergeFiles: True
  KernelTime: True
  SleepPercent: 500
  DataInitTypeAlpha: 1
  DataInitTypeBeta: 0
#  PrintCodeCommands: True
  PrintSolutionRejectionReason: True
  PrintWinnersOnly: True
#  PinClocks: True

